INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (30601, 29006, 'Vardenafil', 'Long QT Syndrome', 'Vardenafil prolongs the QT interval.  Patients taking Class 1A or Class III antiarrhythmic medications or those with congenital QT prolongation, should avoid using this agent.  Caution should be exercised if used in patients with congenital QT syndrome, or using other QT prolonging drugs.', '3', '', 'DDInter', 0);
